// https://styled-components.com/
import styled, { css } from 'styled-components';

export default styled.a`
  background: transparent;
  border-radius: px;
  border: 2px solid white;
  color: white;
  margin: 5px 5px;
  padding: 7px 10px;
  width: 90px;
  height: 50px;

  ${props => props.primary && css`
    background: white;
    color: darkblue;
  `}
`;
